A HISTÓRIA DO UNIVERSO MARVEL
Esse gibi promete ser uma boa leitura. Mark Waid promete contar toda a história do Universo Marvel desde o Big Bang até os dias atuais. Aguardo muita nerdice.

RICK MARTIN ou RICK AND MORTY
Como é volume 1, acho que é republicação.

STAR WARS - O FLAGELO DE SHU-TORUN
Manjo nada desses gibis do Universo Star Wars, mas saiu.

O SONHAR vol 3
Nessa história tem a Rose Walker, personagem de Sandman. Acaba aqui a minha sinopse.

AS QUÍNTUPLAS vol 2
Mangá cômico sobre um professor que tem que levar à formatura cinco irmãs gêmeas que só querem tocar o terror.

DEMON SLAYER vol 8
Está escrito isso na capa: "usando a dança do deus do fogo, tanjirou lança a técnica "céu límpido e azul" em enmu". Nada mais precisa ser dito.

ARLEQUINA - QUEBRANDO VIDRACAS
