#それスノ

キャンプ企画 第２弾
キャンプ映え写真＆即興犬小屋作り
☃️ 💛💜💙💚❤️💗🧡🖤🤍

.

今回も誤字脱字いっぱいの箇条書き感想！
結構、順位とかに触れないと書きにくいけど、順位は書いてない！触れてるところは回避で🧚‍♀️

.

＊深「うちめめ🖤いるんで大丈夫です」今週も、めめ🖤だより（笑） 

＊さくちゃん💗腕まくり！二の腕の筋肉！てか、ホント色白さん✨ 

＊ご褒美は「夕食の食材」聞く限り全部豪華！✨ 

＊さくちゃん💗の肩に腕や手を乗せるひーくん💛そして、ひーくんの肩に腕を乗せるさくちゃん💗最終的に、ひーくん💛とラウ🤍両方に乗せてみる…無理があるよ…さくちゃん💗🤭笑

＊30分でキャンプ映え写真を撮る！

＊阿「勝った！うちには康二がいる」💚🧡❤️
＊康「勝ちましたね」🧡
＊深「これで逆に康二チームは負けられないっすよね」💜ふっかさん痛いところを突く🤭
＊康「これで負けたらAERAの連載終わるわ」

＊審査員は代表取締役。ラ「SNS界のローランドだ」🤍そして、普通に教えてほしい康二くん🧡 

.
 

＊スタートで「突然猛ダッシュするおこちゃまメンバー」が最年長組💜💙💗が可愛すぎる❣️
しかし、さっくん💗を走らせちゃダメよ…さっくん遅いなよ🤭「素のまんま」で、ひーくん💛ラウちゃん🤍が言ってた走りが若干見れるよ😇可愛すぎる💗

.

＊水辺の守り方が独特な悪友コンビ💜💙笑
＊ス「なんで、目黒くん？」翔「モデルだから」
＊先生のタイプがめめ🖤じゃなかったら「めっちゃキレる」と翔太くん（笑）

.

＊Aチームはラウちゃん提案の「バキバキボディで映え写真」💛💗🤍 １７歳はインスタ詳しい🤍そして、やっぱり見てるのね（笑）
＊ラウ「気になれます？」それに答えるひーくん💛
＊ラウの顔に水パシャっ💧に「これって筋肉に関係なくね？」のゆさぴょん

.

＊写真家向井氏のこだわりが出まくりーの🧡❤️💚

.

＊ゆさぴょんに「紫」と「青」と呼ばれる深澤辰哉と渡辺翔太💜💙
＊翔「タイマーっとどうやるの？」な翔太くん💙
＊逆立ち失敗な翔太くん💙可愛い🤦‍♀️

.

＊佐「水遊びしちゃう？」ラ「いいねー」💗🤍
＊急にアイディアが降ってきたひーくん💛そして、水辺の妖精さんなのかな？なさくちゃん🧚‍♀️💗さくちゃんの撮影をひーくん💛がしてて、いわさく🤦‍♀️💛💗

＊ラ「#佐久間を探せ」ここからIsland TVのかくれんぼ来てるのかな？🤍
＊いわさく💛💗並んで芝生に寝転ぶ🤦‍♀️ナイスだラウちゃん🤍

.

＊康二🧡動画を駆使して、スクショ使い！

.

＊石で焼でしそうになる、ふっか💜
＊B型はやる気が出るまで時間がかかる（笑）時間終了と同時に良い写真を撮ろうとする💜💙🖤
＊め「ふっかさん足怪我できます？」ふ「できる」翔「足折れれる？」ふ「折れる、折れる」B型出まくりね🤣

.

＊怪我を聞いて本気で心配する他チーム😇Snow Manの優しさでてる😭💓

.

＊ラ「おい、深澤！深澤！」「この人あれだよ！やらせ王だよ！」🤍最年少が最年長をバッサリ🤣佐「嘘ですって顔」

＊でも撮るとき皆どいてあげるのよね！✨

＊め「ふっかさん治った？大丈夫？」ふ「治った！いける！」

.

＊Aチームと言われ、佐「あ、俺らがAだっけ？」😇
＊叫び声が雄叫びなBチーム💨💨💨
＊みんな若干自分のチーム忘れてるよね？？
＊ラ「連載やめる？」康「連載、来月から渡辺翔太で」😭こーじ😭🧡

.
.
